import React, { Component } from 'react';

//body structure css
import './App.css';

import './Register.css';

class Register extends Component {
    render(){
        return(
            <div id='app'>
                <div id='topContainer'>
                    <div></div>
                </div>
            </div>
        )
    }
}

export default Register;
